import { propTypes } from 'react-bootstrap/esm/Image'
import { TodoItem } from './TodoItem';
import './Todos.css';
export const Todos = (props) => {
    return (
       
            <div className="container">
                <h3>Todos List</h3>
                {props.todos}
                <TodoItem todo={props.todos[2]}/>
            </div>
        
    )
}
